		my $expr = $_[ARGS][1];
		$_[PROG]->symbols->{$name} = $expr;
	}
	elsif (exists $_[PROG]->macros->{$name}) {
								# MACRO call
		$_[PROG]->macros->{$name}->expand_macro($_[INPUT]);
	}
	else {						# NAME label
		$_[PROG]->add_label($name, $_[ARGS][0]->line);
	}
	undef;
}
